import React, { Component } from 'react';


class Sobre extends Component {
    render() {
        return (
            <div className='Sobre' >
                <h1>Somos um brecho que ajuda animais de rua</h1>
                <br></br>
                <h2>100% da renda do brecho vai para os animais</h2>
            </div>
        )
    }
}


export default Sobre
